const RedirectPage =  () => {

    const [short, setShort] = useState("");

    const getLink = async (stringUrl) => {
        var shortUrl= await getUrl({stringUrl});
        console.log(await getUrl({shortUrl}));
        if(shortUrl){
            setShort(shortUrl);
            setLoading(false);
        }
    };


    var stringUrl= window.location.pathname ;
    if(stringUrl.length!==0){
        stringUrl = stringUrl.substring(1);
    }

    const target=getLink(stringUrl);

    var finalValue;
    target.then(function(result) {
        finalValue= result;
    });



    // window.location.href = 'https://google.com';
    // return null;

    return (
        <h5>Mapped value: {finalValue} </h5>
    );

}

